import React from "react";
import "./Header.css"
import  profile  from "../../assets/profile.png";
import { motion } from "framer-motion";



const Header = ({ languages }) => {
  return (
    <div className="Header">

      <motion.div 
        initial={{y: 0}}
        animate = {{opacity: 1}}
        exit= {{opacity:0}}
        transition ={{ duration: 1, ease:"easeInOut"}}
        className="Profile">
          <img src={profile} alt="profile"/>
          <motion.div 
              initial={{opacity: 0}}
              animate = {{opacity: 1}}
              exit= {{opacity:0}}
              transition ={{ duration: 1, ease:"easeInOut"}}
             className="Profile_text">
            <h3 data-testid ="name">Mxolisi Magubane</h3>
            <p data-testid ="bio_description">Hello, World!</p>
          </motion.div>  
      </motion.div>

      <motion.div 
        initial={{opacity: 0}}
        animate = {{opacity: 1}}
        exit= {{opacity:0}}
        transition ={{ duration: 1, ease:"easeInOut"}}
        className="Summary">
        <h2>Summary</h2>
        <hr className="Line"/>
        <p data-testid ="summary_description">I am a Graduate Software Engineer 
skilled in C#, Java, Python, and web development with a keen eye for detail 
and a love for creating clean and efficient code. {'\n'}I am always eager to expand my 
knowledge in the field of software engineering.  {'\n'}I do not mind digging into
boring work, as more often than not, it is where the details that matter are found.</p>
      </motion.div>

      <h2>Skills</h2>
      <hr className="Line"/>
      <motion.div 
        initial={{opacity: 0}}
        animate = {{opacity: 1}}
        exit= {{opacity:0}}
        transition ={{ duration: 1, ease:"easeInOut"}}
        className="Skills_icons">
          <ul>
          {languages.map((item) =>(

              <li  key={item.id}>
                  <img src={item.link}  alt={item.alt}/>
              </li>

            ))}
          </ul>
      </motion.div>
      <h2>Documents</h2>
      <hr className="Line"/>
      <motion.div 
        initial={{opacity: 0}}
        animate = {{opacity: 1}}
        exit= {{opacity:0}}
        transition ={{ duration: 1, ease:"easeInOut"}}
       className="Documents">
          <button
          type="butoon"
          onClick={(e) => {
            e.preventDefault();
            window.location.href ="https://drive.google.com/file/d/1Dfmb1qLiyLU0Enqv3lCqmRV-L_-OGbKE/view?usp=sharing";
          }}
          >Download Resume</button>
      </motion.div>

    </div>
  )
}

export default Header
